import React from "react";
import { Box, Typography } from "@mui/material";
import { Link } from "react-router-dom";

const Header: React.FC = () => {
    return (
        <Box
            sx={{
                width: "100%",
                padding: "1rem 2rem",
                display: "flex",
                justifyContent: "space-between",
                alignItems: "center",
                backgroundColor: "#FFEEEE", // Light pink background
                position: "fixed",
                top: 0,
                zIndex: 1000,
                boxShadow: "0 2px 8px rgba(0, 0, 0, 0.1)",
            }}
        >
            {/* Website Title */}
            <Typography
                variant="h6"
                sx={{
                    color: "#4A2040", // Dark purple
                    fontWeight: "bold",
                }}
            >
                Iva Park
            </Typography>

            {/* Navigation Links */}
            <Box
                sx={{
                    display: "flex",
                    gap: "2rem",
                }}
            >
                <Link
                    to="/"
                    style={{
                        textDecoration: "none",
                        color: "#4A2040",
                        fontWeight: "bold",
                    }}
                >
                    Home
                </Link>
                <Link
                    to="/portfolio"
                    style={{
                        textDecoration: "none",
                        color: "#4A2040",
                        fontWeight: "bold",
                    }}
                >
                    Portfolio
                </Link>
                <Link
                    to="/about"
                    style={{
                        textDecoration: "none",
                        color: "#4A2040",
                        fontWeight: "bold",
                    }}
                >
                    About Me
                </Link>
            </Box>
        </Box>
    );
};

export default Header;
